<div>
        <Form>
            <h1>Sign Up </h1>
            <Form.Group className="mb-3" controlId="formBasicEmail">
                <Container>
                    <Row>
                        <Col> 
                        <Form.Label class="formLabel">First Name</Form.Label>
                        <Form.Control class = "form-control" type="firstName" placeholder="Enter first name" />
                        </Col>
                        <Col> 
                        <Form.Label class="formLabel">Last Name</Form.Label>
                        <Form.Control class = "form-control" type="lastName" placeholder="Enter last name" />
                        </Col>
                    </Row>


                </Container>
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label class="formLabel">Email</Form.Label>

                    <Form.Control type="email" placeholder="Email" />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label class="formLabel">Password</Form.Label>

                    <Form.Control className="form-control" type="password" placeholder="Password" />
            </Form.Group>

            <Form.Select aria-label="User Type">
                <option>Select User Type</option>
                <option value="1">Current Student</option>
                <option value="2">Alumni</option>
                <option value="3">Professor</option>
            </Form.Select>

            <Button id="signUpBtn" variant="primary" type="submit" onClick={this
            .submitLogin.bind(this)}>
            Login
            </Button>


        </Form>


    <p>Already have an account? Click here</p>
</div>
        );
    }
}

export default Login;
